Robyn Rihanna Fenty (born February 20, 1988), known as Rihanna, is a Barbadian singer, model and fashion designer. She also serves as the cultural ambassador for the island of Barbados.She is the first Barbadian artist to officially win a Grammy Award Rihanna is currently signed to the Def Jam Recordings label. She has attained five Billboard Hot 100 number ones thus far (&quot;Umbrella&quot;, &quot;SOS&quot;, &quot;Take a Bow&quot;,&quot;Disturbia&quot; and Live Your Life), four as a solo artist and one as featured artist, and is currently tied as the female solo artist with the most number ones in this decade.

Rihanna broke into the industry in 2005 with the release of her debut album Music of the Sun, which features her hit single &quot;Pon de Replay&quot;. Less than a year later, Rihanna released A Girl Like Me and earned her first number-one single, &quot;SOS&quot;. In 2007, Rihanna released her third studio album, Good Girl Gone Bad. The album has yielded seven hit singles, including four worldwide number one singles: &quot;Umbrella&quot;, &quot;Don't Stop the Music&quot;, &quot;Take a Bow&quot;,&quot;Disturbia&quot;. Since the release of her debut album, Rihanna has amassed twelve top 40 hit singles in the U.S.

